import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Typography } from "@material-ui/core";
import FacebookIcon from "@material-ui/icons/Facebook";
import InstagramIcon from "@material-ui/icons/Instagram";
import GithubIcon from "@material-ui/icons/GitHub";
import LinkedinIcon from "@material-ui/icons/LinkedIn";
import {Link} from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: '#49417a',
    color: 'white'
  },
  heading: {
    fontSize: 30,
    paddingTop: 50
  },
  about: {
    fontSize: 20,
    paddingTop: 40,
  },
  links:{
    fontSize: 15,
    paddingTop:40

  },
  content:{
    color: 'white',
    textDecoration:'none',
  }
}));

export default function Footer() {
  const classes = useStyles();

  return (
    <div style={{ height: "100%", width: "100%" }} className={classes.root}>
      <Grid container spacing={1}>
        <Grid item xs={6}>
          <Typography className={classes.heading} variant="h4" align="center">
          MENTOX  <i class="fas fa-brain"></i>
          </Typography>
          <Typography style={{ marginTop: "20px" }} align="center">
            This website is all about the mental health and meditation.
          </Typography>
          <Typography align="center" style={{ padding: "40px 0 30px 0" }}>
            <FacebookIcon style={{ marginRight: "30px" }} />
            <InstagramIcon style={{ marginRight: "30px" }} />
            <GithubIcon style={{ marginRight: "30px" }} />
            <LinkedinIcon />
          </Typography>
        </Grid>
        <Grid item xs={3}>
          <Typography className={classes.about} align='center' variant="h4">
            About Us
          </Typography>
          <Typography align='center' variant="caption">
            This is all about this page and it is going to be amazing. Since we know that no one know you more than your friends and family so will we connect them as well to make sure you are doing great with the therapy. " Its your life live it don't end it " .
          </Typography>
        </Grid>
        <Grid item xs={3}>
          <Typography className={classes.links} align='center' variant="h4">
            <Link className={classes.content}>Contact Us</Link>
          </Typography>
          <Typography className={classes.links} align='center' variant="h4">
            <Link className={classes.content}>Contact Us</Link>
          </Typography>
          <Typography className={classes.links} align='center' variant="h4">
            <Link className={classes.content}>Contact Us</Link>
          </Typography>
        </Grid>
        <Grid item xs={12}>
          <Typography
            style={{
              backgroundColor: "#58527C",
              padding: "0.8rem 0 0.8rem 0",
              overflow: "hidden",
              color: 'white'
            }}
            align="center"
          >
            Copytight Â© 2021 | MENTOX
          </Typography>
        </Grid>
      </Grid>
    </div>
  );
}
